import React, { Component, Img } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch,
  Redirect
} from 'react-router-dom';
import { Card, Badge, Row, Col, Button, Menu, Icon } from 'antd';
// partials
import Calender from './partials/Calendar';

// css
import './App.css';
import 'antd/dist/antd.css';

class App extends Component {
  state = {
    addEvent: undefined,
    current: 'main'
  }
  handleClick (e) {
    this.setState({
      current: e.key
    })
  }
  tripleCard () {
    let items = [
      'Add Item', 'Delete Item',
      'Misc.'
    ];
    let cards = items.map(
        (item) =>
          <Col span={8}>
          <Button
            type='primary'
            onClick={this.addEvent}
            value='large'>
              {item} </Button>
          </Col>
        )
    return cards;
  }
  menu () {
    return (
      <Menu
        onClick={this.handleClick}
        selectedKeys={[this.state.current]}
        mode="horizontal">
        <Menu.Item key='twitter'>
          <Icon type='twitter'/> Twitter
        </Menu.Item>
        <Menu.Item key='github'>
          <Icon type='github'/> github
        </Menu.Item>
      </Menu>
    )
  }
  render() {
    return (
      <div className="App">
        {this.menu()}
        <Row>
        //
        </Row>
        <Calender/>
      </div>
    );
  }
}

export default App;
